import Ingredients from './Ingredients'

export default function RecipeList({
    recipes,
    handleRecipeAdd,
    handleRecipeDelete,
}) {
    return (
        <>
            <div>
                {recipes.map(recipe => 
                    <Ingredient key={recipe.id}/>
                )}
            </div>



            <button onClick={handleRecipeAdd}>Add recipe</button>
        </>

    )
}
